import React, { Component } from "react";
import { Link } from "react-router-dom";

class Home extends Component {
    render() {
        return (
            <div>
                <nav className="Home" stick>
                    <ul>
                        <li>
                            <Link to="/">Home</Link>
                        </li>
                        <li>
                            <button><Link to="/funny" preventScrollReset={true} >Funny</Link></button>
                        </li>
                        <li>
                            <Link to="/office">Office</Link>
                        </li>
                        <li>
                            <Link to="/family">Family</Link>
                        </li>
                        <li>
                            <Link to="/college">College</Link>
                        </li>
                    </ul>
                </nav>

                <main>
                </main>
            </div>
        );
    }
}

export default Home;
